import React, { useEffect, useRef } from "react";
import Isotope from "isotope-layout";
import imagesLoaded from "imagesloaded";
import GLightbox from "glightbox";
import "glightbox/dist/css/glightbox.css";

import portfolioimg1 from "../assets/img/portfolio/portfolio-1.webp";
import portfolioimg2 from "../assets/img/portfolio/portfolio-2.webp";
// import portfolioimg3 from "../assets/img/portfolio/portfolio-3.webp";
// import portfolioimg4 from "../assets/img/portfolio/portfolio-4.webp";

function Portfolio() {
  const isotopeContainer = useRef(null);
  const iso = useRef(null);

  const powerBIProjects = [
    { type: "image", src: portfolioimg1 },
    { type: "image", src: portfolioimg2 },
    { type: "video", src: "https://www.youtube.com/watch?v=QaXZJO1WlRA" },
  ];

  const excelProjects = [
    { type: "image", src: portfolioimg1 },
    { type: "image", src: portfolioimg2 },
    { type: "video", src: "https://www.youtube.com/watch?v=QaXZJO1WlRA" },
  ];

  useEffect(() => {
    const lightbox = GLightbox({
      selector: ".glightbox",
    });

    imagesLoaded(isotopeContainer.current, () => {
      iso.current = new Isotope(isotopeContainer.current, {
        itemSelector: ".isotope-item",
        layoutMode: "masonry",
        sortBy: "original-order",
      });
    });

    return () => {
      if (iso.current) iso.current.destroy();
      lightbox.destroy();
    };
  }, []);

  const handleFilterClick = (e, filter) => {
    e.preventDefault();
    const active = document.querySelector(".filter-active");
    if (active) active.classList.remove("filter-active");
    e.target.classList.add("filter-active");
    iso.current.arrange({ filter });
  };

  const renderProjectItem = (item, category, index) => (
    <div key={index} className={`col-lg-6 col-md-6 portfolio-item isotope-item ${category}`}>
      <div className="portfolio-card">
        <div className="portfolio-image">
          {item.type === "image" ? (
            <img src={item.src} className="img-fluid" alt="" loading="lazy" />
          ) : (
            <div className="video-container">
              <iframe
                src={item.src}
                title="Project Video"
                frameBorder="0"
                allowFullScreen
              ></iframe>
            </div>
          )}
          <div className="portfolio-overlay">
            <div className="portfolio-actions">
              <a href={item.src} className="glightbox preview-link">
                <i className="bi bi-eye"></i>
              </a>
            </div>
          </div>
        </div>
      </div>
    </div>
  );

  return (
    <main className="main">
      <section id="portfolio" className="portfolio section">
        <div className="container section-title" data-aos="fade-up">
          <h2>Portfolio</h2>
          <p>Your awesome project showcase goes here</p>
        </div>

        <div className="container" data-aos="fade-up" data-aos-delay="100">
          <div className="portfolio-filters-container" data-aos="fade-up" data-aos-delay="200">
            <ul className="portfolio-filters isotope-filters">
              <li
                data-filter="*"
                className="filter-active"
                onClick={(e) => handleFilterClick(e, "*")}
              >
                All
              </li>
              <li
                data-filter=".filter-web"
                onClick={(e) => handleFilterClick(e, ".filter-web")}
              >
                Power BI
              </li>
              <li
                data-filter=".filter-graphics"
                onClick={(e) => handleFilterClick(e, ".filter-graphics")}
              >
                Excel
              </li>
            </ul>
          </div>

          <div
            className="row g-4 isotope-container"
            data-aos="fade-up"
            data-aos-delay="300"
            ref={isotopeContainer}
          >
            {powerBIProjects.map((item, index) =>
              renderProjectItem(item, "filter-web", index)
            )}

            {excelProjects.map((item, index) =>
              renderProjectItem(item, "filter-graphics", index)
            )}
          </div>
        </div>
      </section>
    </main>
  );
}

export default Portfolio;
